import React from "react";

function Header() {
  return (
    <div class="header">
      <li class="navbar">
          <a id="header-content">Makonis</a>
          <li>
            <a id="home" href="./">Home</a>
            <a id="about" href="./">About</a>
          </li>
      </li>
    </div>
  );
}

export default Header;


